import './index.scss'

const MoreProjects = () => {
    return (
        <div className="more-projects">
            <div className="comic-readers">
                <h2>Comic Readers</h2>
                <a target='_blank' href='https://comicreaders.netlify.app/'><span>comicreaders.netlify.app</span></a>
            </div>
        </div>
    );
}

export default MoreProjects;
